//https://leetcode.com/problems/is-subsequence/
#include <iostream>
#include <string>
using namespace std;

class Solution {
public:
    bool isSubsequence(string s, string t) {
        if(s.size()==0)
            return true;
        int pos=t.find(s[0]);
        if(pos==string::npos)
            return false;
        for(const auto& elem:string(s.begin()+1, s.end())){
            int new_pos=t.find(elem,pos+1); //remember pos+1, not just pos
            if(new_pos==string::npos){
                return false;
            }
            if (new_pos==pos){
                return false;
            }
            pos=new_pos;
        }
        return true;
    }
};

int main()
{
    cout << "Hello World!" << endl;
    return 0;
}


